import React from "react";

function Card(props){
    return (<div className="card">
        <h2 className="name">{props.name}</h2>
        <img className="circle-img" src={props.pic}/>
        <div className="buttom">
            <p>{props.tel}</p>
            <p>{props.email}</p>
        </div>
    </div>);
}

function App(){
    return (<Card name="test" pic="../public/3.jpg" tel="1234" email="ee@d.com"/>);

}

export default App;
